import React from 'react';

function ContactCard(props) {
    const imgCont = {
        background: `url(${props.image})`,
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover',
        display: 'block',
        height: '100%',
        width: '15vw',
        borderRadius: '50%',
        border: '1px solid rgb(90, 109, 135)',
    }

    const contDesc = {
        height: '100%',
        width: '60%',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'space-between',
    }

    const nameDesc = {
        display: 'flex',
        flexDirection: 'column',
    }

    const contactDesc = {
        backgroundColor: 'red',
        fontSize: '3vw',
        fontWeight: '600',
        letterSpacing: '1px',
        margin: '0 0 5vh 0',
    }


    return (
        <>
            <div style={ imgCont } className="contactCard"></div>
            <div style={ contDesc }>
                <div style={ nameDesc }>
                    <div style={{fontWeight: '600',fontSize: "2.5vw"}}> {props.name} </div>
                    <div style={{fontSize: '10px'}}> {props.title} </div>
                </div>
                <div style={contactDesc}>
                    {props.email}
                </div>
            </div>
        </>
    );
}

export default ContactCard;
